import React, {Component} from 'react';
import CardList from './CardList';
import {robots} from './robots'

const App = () => {
	return (
		<fragments>
		<h1>Robo Friends</h1>	
		<CardList robots={robots}/>
		</fragments>
	);
}

export default App;
